import React, { useState, useEffect } from "react";
import RocketCard from "../RocketCard";
import {Container} from './styles'
import getRocketInfo from "../../services/getRocketInfo";


const RocketLayout = () => {


  const [rocket, setRocket] = useState([])

   useEffect(() => {
     getRocketInfo().then((data) => setRocket(data));
   }, []);

   console.log(rocket)

  return (
    <Container>
      {rocket.map((item) => (
        <RocketCard
          key={item.id}
          name={item.name}
          info={item.description}
          image={item.flickr_images[1]}
          status={item.active ? "active" : "disabled"}
          boosters={item.boosters}
          company={item.company}
          country={item.country}
          costLaunch={item.cost_per_launch}
          stages={item.stages}
          succesRate={item.success_rate_pct}
          engineLoss={item.emgines.engine_loss_max}
          layout={item.emgines.layout}
          number={item.emgines.number}
          type={item.emgines.type}
          version={item.emgines.version}
          propellant1={item.emgines.propellant_1}
        />
      ))}
    </Container>
  );
};

export default RocketLayout;
